import "./Logo.scss";
import Link from 'next/link'
import img from '../../../public/images/logo_transparent.png';

function HeaderLogo() { 
  return (
    <Link href="/">
      <img src={img} alt="my image" />
    </Link>
  );
}


export default HeaderLogo;
